window.bookSummaryJSON = "<p><b>We're back, purple piglets! And we've come to claim what's ours. To pick up the pieces that we've left behind.</b></p> <p>I didn't expect a welcome home party. Don't get me wrong, it would've been fun, but I didn't expect this either.</p> <p>The moment we stepped out of the gate, we were thrown on another roller coaster.</p> <p>Another battle awaits us - a battle we have to win.</p> <p>There's no time to just go along for the ride. No, I have to take it all head-on.</p> <p>Because I'm Isadora. And I protect everything that's mine. And you better hope you're on that list.</p> <p><b>Contains mature themes.</b></p>"; 
